import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));



function Row (props) {
    const classes = useStyles();

    return (
    <Grid container spacing={0}>
        <Grid item xs={5}>
        <Paper className={classes.paper}><img src={props.thumbnail}></img></Paper>
        <Paper className={classes.paper}><p>{props.first} {props.last}</p></Paper>
        <Paper className={classes.paper}><p>{props.cell}</p></Paper>
        <Paper className={classes.paper}><p>{props.email}</p></Paper>
        <Paper className={classes.paper}><p>{props.dob}</p></Paper>
        </Grid>
    </Grid>
    );
}

export default Row;
